import './Nav.css';
import { Nav } from './Nav';
import { Snav } from './Snav';
import { Tnav } from './Tnav';
import { Fnav } from './Fnav';
import Item from './Item';
import { Footer } from './Footer';

function App() {
  return (
    <div className="App">
      <header>
        <Nav />
        <Snav />
        <Tnav />
        <Fnav />
      </header>
      <Item />

      <Footer />

    </div>
  );
}

export default App;
